import React from 'react';
import profile from './ichigoProfile.png';
import './home.css';


function Home() {
    return (
        <div className='container'>
            <div className='profile_img text-center p-4'>
        <div className='profilepage'>
            <img className='profile'
                style={{
                    width: "200px",
                    height: "200px",
                    borderRadius: "50%",
                    objectFit: "cover",
                    border: "4px solid green",
                        }} src={profile} alt="" /> <label htmlFor="" className='nametag'>Akash Sivapalan</label>
        </div>
            </div>
            <br></br>
           <p>Hello this is Akash blah blah blah</p>
            </div> 
);
}

export default Home;
